  Option,
  OptionGroup,
  RadioGroup,
  Range,
  Row,
  Telephone,
  TextBox,
  UrlInput,
} from "react-form-elements";

const Join = () => {
  return (
    <>
      <Form>
        <TextBox ColorInput />
      </Form>
    </>
  );
};

export default Join;
